import React from 'react';
import '../../css/Forum.css';
import $ from 'jquery';

class Forum extends React.Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div className="forum-container">
                <div className="language-forum-box">
                    <i className="pl flag" style={{ fontSize: "20px"}}/>
                </div>
            </div>
        );
    }
}

export default Forum;
